/b\u003es at de store gruppene i\u003cbr\u003ekommunestyrene vil tape et mandat eller to, til mindre grupper\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_tendens_1744\u003cbr\u003etype: usage\u003c/p\u003e", "x": 614.8191738922502, "y": 242.789626034049}, {"color": "#377eb8", "id": "2012-2019_tendens_7063", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDe b\u00f8r bli enda mer synlige i mediebildet, sier IMDi-direkt\u00f8r\u003cbr\u003eGeir Barvik. N\u00e5r personer med innvandrerbakgrunn intervjues, opplyses\u003cbr\u003edet om denne bakgrunnen i \u00e9n av fire artikler. Sammenlignet med funn\u003cbr\u003efra 2009 og 2011 er det en \u00f8kende \u003cb\u003etendens\u003c/b\u003e til at de uttaler seg\u003cbr\u003euten at det blir gitt opplysninger om personens bakgrunn.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_tendens_7063\u003cbr\u003etype: usage\u003c/p\u003e", "x": 84.45573859482374, "y": -349.47209133521574}, {"color": "#377eb8", "id": "2012-2019_tendens_449", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNegativ \u003cb\u003etendens\u003c/b\u003e\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_tendens_449\u003cbr\u003etype: usage\u003c/p\u003e", "x": -361.11554014175977, "y": -169.9130085420473}, {"color": "#377eb8", "id": "1980-1990_tendens_2264", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eF\u00f8rtidsuttak og utsatt uttak har vaert lite benyttet, og har\u003cbr\u003ederfor i liten grad bidratt p\u00e5 dette punktet. Den \u00f8kte valgfrihet til\u003cbr\u003eseiv \u00e5 velge pensjoneringstidspunktet og pensjonsform, er begrenset\u003cbr\u003etil visse grupper og i praksis til valg av tidligere\u003cbr\u003epensjoneringstidspunkt enn 65 \u00e5r. Det kan bl.a. skyldes det vans-\u003cbr\u003ekelige arbeidsmarkedet og den reduserte kompensasjon for\u003cbr\u003edeltidspensjon. - Forfatterne av rapporten mener det er vanskelig \u00e5\u003cbr\u003ebed\u00f8mme om m\u00e5let om mindre slitasje og helseproblemer for eldre er\u003cbr\u003eblitt oppn\u00e5dd. - Riksfors\u00e5kringsverket mener det f\u00f8rst og fremst er\u003cbr\u003edelpensjonen som har motvirket\u003cb\u003e tendense\u003c/b\u003en til at eldre tvinges\u003cbr\u003etil \u00e5 forlate arbeidslivet. - Arbeidstakernes \u00f8nsker m.h.t. arbeidstid\u003cbr\u003ehar stort sett blitt innfridd og skifte av arbeidsoppg\u00e5ver har vaert\u003cbr\u003euvanlig. - \u00d8konomisk sett har pensj onene generelt hatt en bedre\u003cbr\u003eutvikling enn l\u00f8nningene i perioden 1978-82. - Reformen har ikke\u003cbr\u003emedf\u00f8rt at flere personer i aldersgruppen 65-70 \u00e5r er blitt\u003cbr\u003eyrkesaktiv\u003cspan style=\"color:#808080;\"\u003ee.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_tendens_2264\u003cbr\u003etype: usage\u003c/p\u003e", "x": 123.79306337894106, "y": 353.99251276354147}, {"color": "#377eb8", "id": "2012-2019_tendens_5114", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e- Det er bare Kast som systematisk har snakket med dem som\u003cbr\u003ekj\u00f8per sex. Vi har for lite kunnskap, kanskje fordi vi generelt har en\u003cbr\u003e\u003cb\u003etendens\u003c/b\u003e til \u00e5 lukke \u00f8ynene for avvik. Myndighetene m\u00e5 vaere\u003cbr\u003evillige til \u00e5 i st\u00f8rre grad skaffe seg kunnskap om prostitusjon, ikke\u003cbr\u003ebare diskutere lovverket, sier han. - Her har samfunnet har en jobb \u00e5\u003cbr\u003egj\u00f8re. Han forteller at forslaget fra samtlige organisasjoner p\u00e5 dette\u003cbr\u003efeltet er \u00e5 nedsette et offentlig utvalg til \u00e5 utrede norsk\u003cbr\u003eprostitusjonspolitikk, med en derav f\u00f8lgende stortingsmelding\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_tendens_5114\u003cbr\u003etype: usage\u003c/p\u003e", "x": -698.8132957788068, "y": -295.73989132673626}, {"color": "#377eb8", "id": "2012-2019_tendens_11494", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHvem skal arve verden? L\u00f8nnstagernes andel av bedriftenes\u003cbr\u003everdiskaping \u2013 som det heter \u2013 og av hele nasjonalinntekten, ser ut\u003cbr\u003etil \u00e5 ha en fallende \u003cb\u003etendens\u003c/b\u003e i de fleste land. L\u00f8nnsandelen\u003cbr\u003efaller i land som Japan og Tyskland s\u00e5 vel som USA, Kina og Norge,\u003cbr\u003eskriver artikkelforfatteren.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_tendens_11494\u003cbr\u003etype: usage\u003c/p\u003e", "x": 317.7656926939127, "y": -259.96848963236727}, {"color": "#377eb8", "id": "2012-2019_tendens_10527", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDenne \u003cb\u003etendensen\u003c/b\u003e er allerede dokumentert gjennom flere\u003cbr\u003eterroraksjoner. G\u00e5rsdagens terroraksjon i Kabul understreker et viktig\u003cbr\u003epoeng:\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_tendens_10527\u003cbr\u003etype: usage\u003c/p\u003e", "x": 322.67393129462613, "y": 242.12305736746617}, {"color": "#377eb8", "id": "1980-1990_tendens_2130", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e5r det gjelder helser\u00e5dets gj\u00f8rem\u00e5l i forbindelse med\u003cbr\u003esmittsomme sykdommer og de rent teknisk-hygieniske oppg\u00e5ver, mener\u003cbr\u003eKomiteen det b\u00f8r overveies om ikke disse i hovedsak kan legges direkte\u003cbr\u003etil den lokale helseadministrasjon med vedkommende offentlige lege som\u003cbr\u003eden naermeste ansvarlige. Foruten \u00e5 vaere faglig og administrativ\u003cbr\u003erasjonell, er en slik l\u00f8sning ogs\u00e5 i godt samsvar med de\u003cb\u003en\u003cbr\u003etende\u003c/b\u003ens en kan spore i lovgivningen p\u00e5 dette omr\u00e5det etter\u003cbr\u003esunnhetslovgivninge\u003cspan style=\"color:#808080;\"\u003en.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_tendens_2130\u003cbr\u003etype: usage\u003c/p\u003e", "x": -223.9007660989777, "y": 460.4406395447532}, {"color": "#377eb8", "id": "2012-2019_tendens_10259", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003ePolitimannen Robertsen trener i Sarpsborg Chi og MMA og delvis\u003cbr\u003ei Frontline Academy og har i likhet med Jacobsen hatt en\u003cbr\u003e\u003cb\u003etendens\u003c/b\u003e til \u00e5 g\u00e5 kamper som avsluttes raskt. Robertsen har\u003cbr\u003eavsluttet fire av fem profesjonelle kamper i f\u00f8rste runde, med en\u003cbr\u003eovervekt av knockouts. Robertsen skiller seg
